function FetchModList(){const e=document.querySelector("#modlist");fetch("/modlists/"+MODPACK+".json?t="+(new Date).getTime().toString()).then(e=>e.json()).then(n=>{n.length<1?e.innerHTML="Coming soon...":n.forEach(n=>{const t=document.createElement("div");t.className="mod-entry";const i=document.createElement("span");i.className="entry-name",i.innerText=n.modname;const a=document.createElement("div");a.className="entry-links";const s=document.createElement("a");s.className="mod-link mod-link-ws",s.innerHTML='<i class="fas fa-globe-europe"></i>',s.href=n.website,s.target="_blank",s.title="Website";const l=document.createElement("a");l.className="mod-link mod-link-wiki",l.innerHTML='<i class="fab fa-wikipedia-w"></i>',null===n.wiki?l.classList.add("link-disabled"):(l.href=n.wiki,l.target="_blank",l.title="Mod wiki"),a.appendChild(s),a.appendChild(l),t.appendChild(i),t.appendChild(a),e.appendChild(t)})}).catch(n=>{e.innerHTML="Coming soon..."})}